var tipuesearch = {"pages": [{'title': 'About', 'text': '第一階段分組協同實習: \n 每週分組報告必須包含 html, pdf 與 Youtube 影片: \n 標題: \xa0 2021-協同產品設計實習-stage1-bg12 \n \n 第一位組員學號: 黃詩云40823202 \n 第二位組員學號: 潘奕瑄40823203 \n \n', 'tags': '', 'url': 'About.html'}, {'title': 'Develop', 'text': 'https://github.com/mdecourse/cmsimde \xa0的開發, 可以在一個目錄中放入 cmsimde, 然後將 up_dir 中的內容放到與 cmsimde 目錄同位階的地方, 使用 command 進入 cmsimde 目錄, 執行 python wsgi.py, 就可以啟動, 以瀏覽器 https://localhost:9443\xa0就可以連接, 以 admin 作為管理者密碼, 就可以登入維護內容. \n cmsimde 的開發採用 Leo Editor, 開啟 cmsimde 目錄中的 cmsimde.leo 就可以進行程式修改, 結束後, 若要保留網際內容, 只要將 cmsimde 外部的內容倒回 up_dir 目錄中即可後續對 cmsimde 遠端倉儲進行改版. \n init.py 位於\xa0 up_dir 目錄, 可以設定 site_title 與 uwsgi 等變數. \n \n', 'tags': '', 'url': 'Develop.html'}, {'title': 'HW', 'text': '', 'tags': '', 'url': 'HW.html'}, {'title': 'W2-W3', 'text': '小組網頁\xa0 stage1-bg12 \n 小組倉儲\xa0 stage1-bg12repository \n 專題題目: 鋁罐壓扁機 \n 動機：在系館7樓垃圾桶有時候會看到沒壓扁的鋁罐很佔垃圾桶的空間，所以我們設計此機構希望可以減少此類麻煩 \n 運用原理:直線運動機構分為精確直線運動機構和近似直線運動機構兩類。其中精確直線運動機構的設計思想主要有兩種：一種是利用幾何中的反演變換，把連杆末端的圓弧路徑反演為直線，用機械反演器可以完成這一功能；另一種則是通過兩個不平行的連杆結構，把路徑限制在兩個平面的交線。近似直線運動機構則是通過多個杆件實現自由度為1的連接，調整杆件的長度使得一點的運動軌跡中包含一段近似直的線段。 \n 參考來源: \n \n \n 初版本- \n 設計機構: \n 零件圖 \n \n 組合圖 \n \n \n \n \n 利用此版本了解這個原理，但是模擬出來 考慮到鋁罐從斜面上滾落時，會直接摔出，所以繼續討論改變的方法。 \n 最終版本由組員畫出 \n \n \n \n', 'tags': '', 'url': 'W2-W3.html'}, {'title': 'w4', 'text': '\xa0小組html: stage1-bg12 \n 小組reveal: stage1-bg12/reveal \n 小組pdf: stage1-bg12/pdf \n 個人Youtube 影片連結: 40823203/youtube \n 小組outube 影片連結: stage1-bg12/youtube \n', 'tags': '', 'url': 'w4.html'}, {'title': '問題', 'text': '', 'tags': '', 'url': '問題.html'}, {'title': '問題1', 'text': '不小心把commit的紀錄刪掉 \n \n 和組員一起解決問題 \n 搜尋問題 \n git reset -- hard {commit id} 之後再推送 \n \n \n 再git pull \n \n 成功了!!!!! \n \n', 'tags': '', 'url': '問題1.html'}]};